// https://github.com/andykellr/tinymce-plugin-tabindex
tinymce.PluginManager.add("tabindex",function(e){e.on("PostRender",function(){var t,n=e.settings.tabindex||"element";if(n===-1){return}if(n==="element"){n=e.dom.getAttrib(e.getElement(),"tabindex",null)}if(!n){return}t=document.getElementById(e.id+"_ifr");if(!t){return}e.dom.setAttrib(t,"tabindex",n)})})